import React from "react";
import { Eye, Pencil, Play } from "react-bootstrap-icons";

export default function TableProjects(props: any) {
  return (
    <tbody>
      {props.data.map((item: any, index: number) => {
        return (
          <tr>
            <td hidden>{item.id}</td>
            <td  style="text-align: center">{index + 1}</td>
            <td  style="text-align: center">{item.name}</td>
            <td  style="text-align: center">{item.deadLine}</td>
            <td  style="text-align: center">{item.timePerWeek}</td>
            <td  style="text-align: center">{item.isCompleted}</td>
            <td  style="text-align: center">{item.isCompleted}</td>
            <button type="button" className="btn btn-primary mb-2 mt-2">
              <Eye color="white" size={15} />
            </button>
            <button type="button" className="btn btn-success ml-2">
              <Pencil color="white" size={15} />
            </button>
            <button type="button" className="btn btn-danger ml-2">
              <Play color="white" size={15} />
            </button>
          </tr>
        );
      })}
    </tbody>
  );
}
